    componentDidMount() {
        axios.get('http://localhost:3001/regiones')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }

    render() {
        const { reg } = this.state
        return (
            <div>
                {prop.map((item) => {

